import { Link } from "react-router-dom";
import './statusColumn.css';
import React from "react";
function StatusColumn() {
    return (
      <div className="choiceContainer">
        <h1>Choice1</h1>
        <h3>Date: </h3>
        <h3>Time: </h3>
        <h3>Place: </h3>
        <Link><button>Choose</button></Link>
        </div>
    );
  }
export default StatusColumn;
